#Requires -Version 2

$Algonquian = ""
$Falsehoods = ""
$Perception = ""
$Arrogating = ""
$Timberland = ""
$Dirigibles = ""
$Pollutants = ""
$Disrespect = ""
$Landmasses = ""
$Mozambican = ""
$Springtime = ""
$Tyrannized = ""
$Precipices = ""
$Entrapping = ""
$Shipwright = ""
$Overwhelms = ""
$Unavailing = ""
$Disuniting = ""
$Romanesque = ""
$Ungrateful = ""
$Expressing = ""
$Observable = ""
$Microphone = ""
$Motorizing = ""
$Honeycombs = ""
$Indentured = ""

$Modules = @($Algonquian,$Falsehoods,$Perception,$Arrogating,$Timberland,$Dirigibles,$Pollutants,$Disrespect,$Landmasses,$Mozambican,$Springtime,$Tyrannized,$Precipices,$Entrapping,$Shipwright,$Overwhelms,$Unavailing,$Disuniting,$Romanesque,$Ungrateful,$Expressing,$Observable,$Microphone,$Motorizing,$Honeycombs,$Indentured)
$Modules | ForEach-Object {
    $Decoded = [System.Convert]::FromBase64String($_)
    if ($_ -like "H4s*") {
        $Decoded = ConvertFrom-Gzip -Bytes $Decoded
    }
    else {
        $Decoded = [Text.Encoding]::UTF8.GetString($Decoded)
    }
    $ScriptBlock = $ExecutionContext.InvokeCommand.NewScriptBlock($Decoded)
    . $ScriptBlock
    Remove-Variable -Name "Decoded"
    Remove-Variable -Name "ScriptBlock"
}
Remove-Variable -Name "Modules"
@("Algonquian","Falsehoods","Perception","Arrogating","Timberland","Dirigibles","Pollutants","Disrespect","Landmasses","Mozambican","Springtime","Tyrannized","Precipices","Entrapping","Shipwright","Overwhelms","Unavailing","Disuniting","Romanesque","Ungrateful","Expressing","Observable","Microphone","Motorizing","Honeycombs","Indentured") | ForEach-Object { Remove-Variable -Name $_ }
